column8:
体に欠かせない栄養素を補給しながらカロリーコントロールできるおきかえダイエット食のフレークタイプです。濃厚チョコレート味、アップルシナモン味、キャラメルモカ味の3味を各5袋ずつセットにしました。
フレークには噛みごたえの異なるブランフレーク、コーンフレーク、大豆パフを使用し、ダイエット中に満たしにくい「食べた感」を満足させる噛みごたえ抜群の食感に仕上げました。冷水で溶かすだけでミルク感のあるコクが味わえ、大満足のおいしさ。しかも、1食あたりたった235kcal以下なのもうれしいポイントです。
1袋で1回の食事に必要なたんぱく質、16種類のビタミン・ミネラルを摂ることができます。さらに、コエンザイムQ10、オルニチン塩酸塩、コラーゲン、プレヒアルロン酸（N-アセチルグルコサミン）、食物繊維といった、キレイとダイエットをサポートする成分も積極的に配合しました。
1日2食のおきかえを限度に、朝・昼・夜、いつでもどうぞ。<br><br>■濃厚チョコレート味<br>カカオ感あふれる濃厚でリッチなチョコレートの味わいが絶妙なハーモニーを奏でる一品。皮付きローストアーモンドの香ばしさと風味がアクセントに。<br>■アップルシナモン味<br>りんごとほんのりとシナモンが香る一品。りんごの爽やかな甘みと、果肉の食感が贅沢に味わえるアップルパイを思わせるスイーツのようなフレークです。<br>■キャラメルモカ味<br>キャラメルの風味とコーヒーのほろ苦いコクがマッチ。アクセントにサクッとしたココアビスケットをプラスした甘さを抑えた大人の味わいです。 <br><br>
