■メーカー:ＤＨＣ<br>■賞味期限:（メーカー製造日より）12カ月<br>■ハイグレード版コラーゲンドリンク。濃密補給で『ぷるるん』を翌朝実感！「DHCコラーゲンビューティ7000プラス」をさらにパワーアップさせたハイグレード版です。1本にコラーゲンペプチドを12,000mgも配合。さらに、美容サポート成分を20種類も配合し、弾力とうるおいに満ちあふれたキレイを強力にサポートするプレミアムな1本に仕上げました。エイジングが気になりだした方や、特別な日のためのスペシャルケアに。おやすみ前にお飲みいただくのをおすすめします。どなたでも飲みやすいトロピカルフルーツ味。<br>「DHCコラーゲンビューティ7000プラス」で実績のある、吸収されやすくコラーゲン合成力が高い『効率型コラーゲン』に加えて、DHC独自の『保湿型コラーゲン』を配合しました。『保湿型コラーゲン』は、うるおい成分・ヒアルロン酸の合成にアプローチして細胞の働きを活性化させるコラーゲンです。この2つのコラーゲンが強力タッグを組んで、あなたのキレイを全力サポートします。<br>1日1本を目安にお召し上がりください。<!--▼おすすめ商品（目玉商品機能）タイトル画像-->
